import React from "react";
import { Link, useNavigate } from "react-router-dom";

const InstructorNavbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("instructorToken");
    navigate("/instructor/login");
  };

  return (
    <nav className="w-full bg-green-700 text-white shadow-md px-6 py-4 flex items-center justify-between">
      {/* Logo */}
      <Link
        to="/instructor/my-lectures"
        className="text-2xl font-bold tracking-wide"
      >
        Instructor Panel
      </Link>

      {/* Navigation */}
      <div className="hidden md:flex items-center space-x-8 text-lg">
        <Link
          to="/instructor/my-lectures"
          className="hover:text-gray-200 transition"
        >
          My Lectures
        </Link>
      </div>

      {/* Logout */}
      <button
        onClick={handleLogout}
        className="bg-red-500 px-4 py-2 rounded-md hover:bg-red-600 transition text-sm md:text-base"
      >
        Logout
      </button>
    </nav>
  );
};

export default InstructorNavbar;
